import React from 'react';

export default function Home() {
  return (
    <div className="text-center p-5">
      <h1 className="display-4 text-primary">Welcome to CleanSwift</h1>
      <p className="lead">Reliable & affordable home cleaning services</p>
      <img src="https://cdn.pixabay.com/photo/2017/06/07/18/25/sponge-2389128_1280.jpg" alt="Cleaning" className="img-fluid rounded shadow mt-4" />
    </div>
  );
}
